import Vue from 'vue'
import Router from 'vue-router'
import Home from '@/components/Home'
import Hello from '@/components/HelloWorld'

Vue.use(Router)
export default new Router({
  mode: 'history',
  routes: [
    {
      path: '/',
      name: 'Home',
      component: Home
    },
    {
      path: '/hello',
      name: 'Hello',
      component: Hello
    },
    {
      path: '/contacts',
      name: 'Contacts',
      component: Contacts
    },
    {
      path: '/services',
      name: 'Services',
      component: Services
    },
    {
      path: '/services/web',
      name: 'Web',
      component: Web
    },
    {
      path: '/services/design',
      name: Design,
      component: Design
    },
    {
      path: '/services/videos',
      name: 'Videos',
      component: Videos
    }
  ]
})
